  input: TEXT,F3XN,,"On March 17, 2005, the committee converted from a principal campaign
    committee (Quinn for Congress) to a political action committee (Jack PAC).  For
    the period January 1, 2005 through March 16, 2005, the committee operated under
    the rules and regulations of a principal campaign committee.  On March 17, 2005,
    an amended FEC Form 1, Statement of Organization, was filed, indicating the name
    change to Jack PAC and the change in status to a committee that supports/opposes
    more than one Federal candidate, and that it is not a separate segregated fund
    or party committee.  The committee had met the conditions for becoming a multicandidate
    committee when it was still a principal campaign committee.  Specifically, the
    committee had been registered as a political committee that had been registered
    under 2 U.S.C 433 for a period of not less than 6 months, had received contributions
    from more than 50 persons, and had made contributions to 5 or more candidates
    for Federal office.  Therefore, the committee effectively became a multicandidate
    committee on March 17, 2005.  The committee has followed the rules and regulations
    of a multicandidate committee since March 17, 2005.  Form 1M was filed on July
    27, 2005, confirming the committee's status as a multicandidate committee."
